import User from "./User"
import { useState, useEffect } from "react"
import axios from "axios"

const Users =()=> {

    const [ user, setUser ] = useState([])

    useEffect(()=> {
        axios.get('http://localhost:3005/api/user')
            .then(res => {
                setUser(res.data)
            })
    }, [])

    const userComponents = user.map(user => {
        return <User 
                    key={user.user_id}
                    lastName={user.lName}
                    firstName={user.fName}
                    username={user.username}
                    email={user.email}
                    dateCreated={user.date_created}
                />
    })

    return(
        <main className="main" id="usersMain">
            <div className="container mt-5 users-con">
                <h2 className="display-3 text-capitalize user-h2">users</h2>
                <div className="row">
                    { userComponents }
                </div>
            </div>
        </main>
    )
}

export default Users
